	<script type="text/javascript">
		var checkboxesId = ["L1", "L2", "L3", "L4", "L5", "L6", "L7", "L8", "L9", "L10", "L11", "L12", "L13", "L14", "L15", "DN", "DH", "DEX", "DR", "F_", "FNF", "FF", "R_", "RC", "RB", "RB2", "RA", "RA2", "RS", "RP"];
		var checkboxesStateCache = null;
		function getCheckboxesState() {
			let ret = {};
			for (let v of checkboxesId) {
				ret[v] = document.getElementById(v).checked;
			}
			return ret;
		}

		$("#filterform").submit(function (e) {
			e.preventDefault();
			checkboxesStateCache = getCheckboxesState();
			var newtable = $('#querytable').DataTable().draw();
		});

		$.fn.dataTable.ext.search.push(function (settings, data, dataIndex) {
			var difficulty = data[0], level = data[1], fc = data[4], score = data[3];
			var csc = checkboxesStateCache;
			var alive = true;

			if (!csc["L1"] && level == "1")
				alive = false;
			if (!csc["L2"] && level == "2")
				alive = false;
			if (!csc["L3"] && level == "3")
				alive = false;
			if (!csc["L4"] && level == "4")
				alive = false;
			if (!csc["L5"] && level == "5")
				alive = false;
			if (!csc["L6"] && level == "6")
				alive = false;
			if (!csc["L7"] && level == "7")
				alive = false;
			if (!csc["L8"] && level == "8")
				alive = false;
			if (!csc["L9"] && level == "9")
				alive = false;
			if (!csc["L10"] && level == "10")
				alive = false;
			if (!csc["L11"] && level == "11")
				alive = false;
			if (!csc["L12"] && level == "12")
				alive = false;
			if (!csc["L13"] && level == "◇1")
				alive = false;
			if (!csc["L14"] && level == "◇2")
				alive = false;
			if (!csc["L15"] && level == "◇3")
				alive = false;

			if (!csc["DN"] && difficulty == "Normal")
				alive = false;
			if (!csc["DH"] && difficulty == "Hard")
				alive = false;
			if (!csc["DEX"] && difficulty == "Expert")
				alive = false;
			if (!csc["DR"] && difficulty == "Real")
				alive = false;

			if (!csc["F_"] && fc == "-")
				alive = false;
			if (!csc["FNF"] && fc == "NF")
				alive = false;
			if (!csc["FF"] && (fc == "F" || fc == "F2"))
				alive = false;

			if (!csc["R_"] && score < 700000)
				alive = false;
			if (!csc["RC"] && score >= 700000 && score < 750000)
				alive = false;
			if (!csc["RB"] && score >= 750000 && score < 800000)
				alive = false;
			if (!csc["RB2"] && score >= 800000 && score < 850000)
				alive = false;
			if (!csc["RA"] && score >= 850000 && score < 900000)
				alive = false;
			if (!csc["RA2"] && score >= 900000 && score < 950000)
				alive = false;
			if (!csc["RS"] && score >= 950000 && score < 1000000)
				alive = false;
			if (!csc["RP"] && score == 1000000)
				alive = false;

			return alive;
		});

		$(document).ready(function () {
			checkboxesStateCache = getCheckboxesState();
			let jsonData = JSON.parse(document.getElementById("json-data").textContent)
			let osDesc = [ "desc", "asc" ];
			let option = {
				data: jsonData,
				autoWidth: false,
				// scrollX: true, うまく動かない。
				pageLength: 25, 
				columns: [
					{ 
						name: "diff", visible: false,
						render (data, type) {
							if (type === "sort" || type === "type") {
								switch (data) {
									case "Normal": return 1;
									case "Hard": return 2;
									case "Expert": return 3;
									case "Real": return 4;
								}
							}
							else {
								return data;
							}
						}
					},
					{ 
						name: "level", className: "level", width: "2ex", orderSequence: osDesc, orderData: [1, 0],
						render (data, type, row) {
							if (type === "display") {
								let color
								switch (row[0]) {
									case "Normal": color = "green"; break;
									case "Hard": color = "orange"; break;
									case "Expert": color = "red"; break;
									case "Real": color = "purple"; break;
								}
								return `<font color="${color}">${data}</font>`;
							}
							else if (type === "sort" || type === "type") {
								let mat = /◇(\d+)/.exec(data);
								return mat ? Number(mat[1]) + 12 : data;
							}
							else {
								return data;
							}
						} 
					},
					{ 
						name: "title", width: "30%", 
						render (data, type, row) {
							if (type === "display") {
								let id = /id=([^&]+)/.exec(location.search)[1];
								let code = row[8];
								let diff = row[0];
								return `<a href="chart_detail.php?id=${id}&code=${code}&diff=${diff}">${data}</a>`;
							}
							else {
								return data;
							}
						}
					},
					{ name: "score", className: "short-data", width: "7ex" },
					{ 
						name: "fc", className: "short-data", width: "2ex",
						render (data, type) {
							if (type === "sort" || type === "type") {
								switch (data) {
									case "-": return 1;
									case "NF": return 2;
									case "F": return 3;
								}
							}
							else {
								return data;
							}
						}
					},
					{ name: "note", className: "short-data", width: "4ex" },
					{ name: "bgrade", className: "short-data", width: "6ex", orderSequence: osDesc },
					{ name: "rgrade", className: "short-data", width: "6ex", orderSequence: osDesc },
					{ name: "code", visible: false },
				], 
				order: [[1, "desc"]], 
			}
			let newtable = $('#querytable').DataTable(option);
			$('#querytable').show();
		});
	</script>
